import React, { Component } from "react";
import { Form, Input, Select,Row, Table, Col,Card,Modal,Drawer,Button,Icon} from "antd";

class ModalDialog extends React.Component {
  render() {
    return (
      <Chart width={400} height={400} data={data} scale={scale}>
        <Tooltip showTitle={true} />
        <Axis />
        <Legend dataKey="item" />
        <Coord type="theta" radius={0.75} innerRadius={0.6} />
        <Pie position="percent" color="item" style={{ stroke: '#fff', lineWidth: 1 }}
          label={['percent', {
            formatter: (val, item) => {
              return item.point.item + ': ' + val;
            }
          }]}
        />
      </Chart>
    );
  }
}
export default ModalDialog;
